g2:c.PROCEDURE.g2:a.TEXT:
get-class-instance-manager-initial-state-event (Manager: class class-instance-event-manager) = (class class-instance-event)
Event: class class-instance-event;
begin
    Event = call _ievlnr-create-current-state-event (Manager);
    return Event;
end

g2:c.METHOD.g2:a.TEXT:
add-class-instance-event-listener (Manager: class class-instance-event-manager {The manager which is to notify Listener}, Listener: class class-instance-event-listener {The listener in the remote system which will be notified of changes})
{This API should be called from an object manager client when that client wishes to listen to change events that effect an object manager view.  The proper manager for this call can be obtained by calling get-object-manager-event-manager.  Listener is added to as an event listener to the manager.}
ListenerList: class item-list;
MonitoredObject: class gfr-object-with-uuid;
MonitoredSequence: sequence;
Client: class ui-client-item = gfr-default-window; {Couldn't this be the Client of the listener?}
begin
    ListenerList = call get-event-listener-list (Manager);
    {First listener - begin listening for all classes which could be deleted.  Limited to named items for now, because Object Manager deals only with named items}
    if the number of elements in ListenerList = 0 then begin
        MonitoredSequence = call _ievlnr-create-sequence-of-instances (Manager);
        for MonitoredObject = each gfr-object-with-uuid in MonitoredSequence do
            if MonitoredObject has a name then start _ievlnr-streamlined-deletion-monitor (MonitoredObject, Manager, Client)
            else start _ievlnr-monitor-for-receipt-of-name (MonitoredObject, Manager, 60, Client);
        end;
    end;
    call add-g2-event-listener (Manager, Listener);
end

remove-class-instance-event-listener (Manager: class class-instance-event-manager {The manager which Listener is to be removed from}, Listener: class class-instance-event-listener {The listener in the remote system which will is to be removed})
{This API should be called to remove a Listener from a ViewManager.}
ListenerList: class item-list;
MonitoredObject: class gfr-object-with-uuid;
Client: class ui-client-item = gfr-default-window; {Couldn't this be the Client of the listener?}
begin
    call remove-g2-event-listener (Manager, Listener);
    ListenerList = call get-event-listener-list (Manager);
    if the number of elements in ListenerList = 0 then call _ievlnr-cancel-all-deletion-monitors (Manager, Client);
    if Listener is a _ievlnr-internal-state-monitor then delete Listener;
end

g2:c.PROCEDURE.g2:a.TEXT:
get-class-instance-event-manager (ClassType: symbol) = (class class-instance-event-manager )
{This API should be called from a remote client when needs a manager for the object manager}
Error: class error;
begin
    if ClassType = the symbol PALETTE then return default-palette-manager 
    else if ClassType = the symbol BROWSER then return default-browser-manager
    else begin
        create an error Error;
        signal Error;
    end  
end

