g2:c.PROCEDURE.g2:a.TEXT:
_ievlnr-create-current-state-event(Manager: class class-instance-event-manager) = (class class-instance-event)
Event: class class-instance-event;
EventList: sequence = sequence ();
Listener: class _ievlnr-internal-state-monitor;
MonitoredObject: class gfr-object-with-uuid;
MonitoredSequence: sequence;
PI: class _ievlnr-deletion-monitor;
begin
    Event = call g2-event-create-event(class-instance-event, Manager); 
    if there exists a _ievlnr-internal-state-monitor Listener that is _ievlnr-monitoring-state-of Manager then EventList = the _ievlnr-state-data of Listener
    else begin
        create a _ievlnr-internal-state-monitor Listener;
        conclude that Listener is _ievlnr-monitoring-state-of Manager;
        call add-class-instance-event-listener (Manager, Listener);
        MonitoredSequence = call _ievlnr-create-sequence-of-instances (Manager);
        for MonitoredObject = each gfr-object-with-uuid in MonitoredSequence do
            if MonitoredObject has a name then EventList = insert-at-end (EventList, structure (item-name: "[the name of MonitoredObject]"));
        end;
        conclude that the _ievlnr-state-data of Listener = EventList;
    end;
    conclude that the event-data of Event = structure (event-type: the symbol NEW-STATE, event-list: EventList);
    return Event;
end

g2:c.METHOD.g2:a.TEXT:
oos-invalidate-view (Manager: class class-instance-event-manager {the manager to be updated}, Nodes: sequence {A sequence of structures defining the information for the deleted nodes}, Client: class ui-client-item {the client for this call})
{This method is called to invalidate the views.<p>} 
ListenerList: class item-list;
Listener: class class-instance-event-listener;
Event: class class-instance-event;
ListenerError: class error;
begin
    ListenerList = call get-event-listener-list (Manager);
    Event = call g2-event-create-event(class-instance-event, Client);
    conclude that the event-data of Event = structure (event-type: the symbol INVALIDATE, event-list: Nodes);
    for Listener = each class-instance-event-listener in ListenerList do
        begin 
            call invalidate-item-cache  (Listener, Event);
        end on error(ListenerError)
            { Obviously it is not behaving, so remove it from listener list}
            call remove-g2-event-listener (Manager, Listener);
            signal ListenerError;
        end;
    end; 
    delete Event; 
end

oos-update-view-per-deletion(Manager: class class-instance-event-manager {the manager to be updated}, Nodes: sequence {A sequence of structures defining the information for the deleted nodes}, Client: class ui-client-item {the client for this call})
{This method is called to update the views in response to one or more nodes being removed from the object manager.  This method should never be called either by the user-written KB code or by the remote browser itself.<p>} 
ListenerList: class item-list;
Listener: class class-instance-event-listener ;
Event: class class-instance-event;
ListenerError: class error;
begin
    ListenerList = call get-event-listener-list (Manager);
    Event = call g2-event-create-event(class-instance-event, Client);
    conclude that the event-data of Event = structure (menu-event-type: the symbol DELETION, event-list: Nodes);
    for Listener = each class-instance-event-listener in ListenerList do
        begin 
            call items-deleted (Listener, Event);
        end on error(ListenerError)
            { Obviously it is not behaving, so remove it from listener list}
            call remove-g2-event-listener (Manager, Listener);
            signal ListenerError;
        end;
    end; 
    delete Event; 
end

oos-update-view-per-addition (Manager: class class-instance-event-manager {the manager to be updated}, GFRObject: class gfr-object-with-uuid, Client: class ui-client-item {the client for this call})
{This method is called to update the views in response to one or more nodes being added to the menu.<p>}
ListenerList: class item-list;
Listener: class class-instance-event-listener;
Event: class class-instance-event;
ListenerError: class error;
begin
    ListenerList = call get-event-listener-list (Manager);
    if the number of elements in ListenerList = 0 then begin
        call _ievlnr-cancel-deletion-monitor (GFRObject, Manager, Client);
        return;
    end;
    Event = call g2-event-create-event (class-instance-event, Client);
    conclude that the event-data of Event = structure (event-type: the symbol ADDITION, event-list: sequence (structure (item-name: "[the name of GFRObject]")));
    for Listener = each class-instance-event-listener in ListenerList do
        begin
            call items-added (Listener, Event);
        end on error (ListenerError)
            { Obviously it is not behaving, so remove it from listener list}
            call remove-g2-event-listener (Manager, Listener);
            signal ListenerError;
        end;
    end;
    delete Event;
end

g2:c.PROCEDURE.g2:a.TEXT:
_ievlnr-cancel-deletion-monitor (MonitoredItem: class gfr-object-with-uuid, Registrant: class class-instance-event-manager, Client: class object)
PI: class _ievlnr-deletion-monitor ;
begin
    for PI = each _ievlnr-deletion-monitor that is _ievlnr-monitoring-for-deletion MonitoredItem do
        if PI is _ievlnr-serving-delete-events-to Registrant then abort PI;
    end;
end

_ievlnr-cancel-all-deletion-monitors (Registrant: class class-instance-event-manager, Client: class object)
PI: class _ievlnr-deletion-monitor;
begin
    for PI = each _ievlnr-deletion-monitor that is _ievlnr-serving-delete-events-to Registrant do
        abort PI;
    end;
end

_ievlnr-streamlined-deletion-monitor (MonitoredObject: class gfr-object-with-uuid, Registrant: class class-instance-event-manager, Client: class Object)
PI: class procedure-invocation;
CallbackData: sequence = sequence (structure ());
NameDeleted: text;
begin
    if MonitoredObject does not exist then begin
        call oos-invalidate-view (Registrant, sequence(), Client);
        return;
    end;
    call _ievlnr-cancel-deletion-monitor (MonitoredObject, Registrant, Client);
    PI = this procedure-invocation;
    conclude that PI is _ievlnr-monitoring-for-deletion MonitoredObject;
    conclude that PI is _ievlnr-serving-delete-events-to Registrant;
    NameDeleted = "[the name of MonitoredObject]";
    CallbackData = sequence (structure (item-name: NameDeleted));
    repeat
        wait until the gfr-uuid of MonitoredObject receives a value;
        if MonitoredObject does not exist and Registrant exists then begin
            call oos-update-view-per-deletion (Registrant, CallbackData, gfr-default-window);
            return;
        end;
    end;
end

_ievlnr-monitor-for-receipt-of-name (GFRObject: class gfr-object-with-uuid, Manager: class class-instance-event-manager, WaitPeriod: integer, Client: class ui-client-item)
begin
    repeat
        wait for WaitPeriod;
        if GFRObject does not exist then return;
        if GFRObject has a name then begin
            start _ievlnr-streamlined-deletion-monitor (GFRObject, Manager, Client);
            call oos-update-view-per-addition(Manager, GFRObject, Client);
            return;
        end;
    end
end

_ievlnr-startup-procedure (Obj: class gfr-startup-object) 
Client: class ui-client-session;
StartError: class error;
  devstuffName: symbol = the symbol gdev-internals-workspaces; 
  intstuffName: symbol = the symbol int-internals-workspaces;
begin
  {--- For devstuff development environment } 
  if the item S named by devstuffName exists and _ievlnr-internals is not a member of S then
    insert _ievlnr-internals at the end of the item-list named by devstuffName;
  if the item S named by intstuffName exists and _ievlnr-internals is not a member of S then
    insert _ievlnr-internals at the end of the item-list named by intstuffName;
 
   { There are currently no clients who need this wakeup, and it causes log messages for
      the Integrity client.}
   { for Client = each ui-client-session do
        begin call start-all-listeners (Obj) across the ui-client-interface of Client;
        end on error (StartError)
            Trap error - RPC not in this UI-CLIENT-SESSION
            signal StartError;
        end;
    end; }
end
